function alertTitleModal(a,r,t){var e="modal-header text-",l="btn btn-";switch(a){case"Error":e+="danger",l+="danger";break;case"Information":e+="info",l+="info";break;case"Success":e+="primary",l+="primary";break;default:e+="muted",l+="default"}$("#alert-msg-title").html(r),$("#alert-msg-body").html(t),$("#alert-msg-header").attr("class",e),$("#alert-msg-button").attr("class",l),$("#alert-msg-modal").modal("show")}function alertModal(a,r){alertTitleModal(a,a.toString(),r)}var alertType={Error:"Error",Information:"Information",Success:"Success",Default:"Message"};